import React from 'react'
import { Outlet, Link } from "react-router-dom";
import Home from './components/Home.jsx';
import {GlobalStyle, StyledFieldset, StyledButton} from "./components/Style.js"
import {useHistory} from "react-router-dom";

function navigateTo(link) {
  const history = useHistory()
  navigate(link)
}

function Survey() {
  return (
    <>
    <GlobalStyle/>
      <nav>
        <ul>
          <div>
            <StyledButton onClick={navigateTo("/Home")}>Click here to start the survey</StyledButton>
          </div>
        </ul>
      </nav>

      <Outlet />

    </>
  )
}

export default Survey;
